import React from 'react';
import styled from 'styled-components/native';
import HomePage from './components/HomePage'

const Container = styled.View`
  flex: 1;
  background-color: white;
  justify-content: center;
  align-items: center;
`


const App = () => {
return (
  <Container>
    <HomePage />
  </Container>
)

}

export default App;
